import Header from '../components/Header'


export default function Contact() {
    return(
        <div>
        <Header />
        <p> This is contact page</p>
        <Link href='/contact'>
            <a className={styles.headerContainer2}>Contact</a>
        </Link>
        </div>
    )
}
